window.bookSummaryJSON = "<p>Somnia is evolving, and Murmur is confronted with enemies both old and new. She must lead her guild, Fable, through a dungeon filled with riddles and puzzles to claim the first of 12 keys required to achieve victory. But things are not as they seem: Glitches abound, enemies rally against Fable, and unexpected threats move in the shadows.</p> <p>As the system becomes increasingly complex, Laria and Shayla battle through mismatched coding, and Storm Corp discovers they’ve left some anomalies in the game out of their reports. Anomalies like Wren.&nbsp;</p> <p>With the report deadline looming and errors riddling the system, Laria’s house of cards is about to come crashing down.</p>"; 
